import React from 'react'

// MaterialUI Elements
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';

import * as adminApi from "../../../api/admin"

export default function SeasonsItems(props) {
    const months = ["January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December"];

    const {
        SEASON_DESCRIPTION,
        SEASON_END_DAY,
        SEASON_END_MONTH,
        SEASON_NAME,
        SEASON_START_DAY,
        SEASON_START_MONTH,
    } = props

    console.log(props)

    return (
        <React.Fragment>
            <Card sx={{ maxWidth: 345 }}>
                <CardContent>
                    <Typography gutterBottom variant="h5" component="div">
                        {SEASON_NAME}
                    </Typography>
                    <Typography variant="body2" color="text.secondary" sx={{height: "10rem", overflow: "hidden", textOverflow: "ellipsis",}}>
                        {SEASON_DESCRIPTION}
                    </Typography>
                    <Typography variant='subtitle1' sx={{marginTop: "0.5rem"}}>
                        runs from {`${SEASON_START_DAY} ${months[SEASON_START_MONTH]} - ${SEASON_END_DAY} ${months[SEASON_END_MONTH]}`}
                    </Typography>
                </CardContent>
                <CardActions>
                    <Button 
                        size="small" 
                        // onClick={handleClickOpen}
                    >
                        Edit
                    </Button>
                    <Button 
                        size="small" 
                        color="error" 
                        // onClick={handleClickOpenDelete} 
                        >
                        Delete
                    </Button>
                </CardActions>
            </Card>
        </React.Fragment>
    )
}
